import React from 'react';
import { StyleSheet,View } from 'react-native';

export default FooterBar = (props) => {
    return(
      <View style={styles.footer}></View>
    )
  }

  const styles = StyleSheet.create({
    footer: {
      height: 70,
      backgroundColor: 'green',
      alignItems: 'stretch',
    }
  });
